<span class="line"><span style="color:#ABB2BF;">  </span><span style="color:#E06C75;">birthday</span><span style="color:#ABB2BF;">: </span><span style="color:#E5C07B;">row</span><span style="color:#ABB2BF;">.</span><span style="color:#E5C07B;">bio</span><span style="color:#ABB2BF;">.</span><span style="color:#E06C75;">birthday</span></span>
